class Header extends Component {
  render() {
    return (
      <div className="header">
        <div>
          <h1>RentACar</h1>
        </div>

        <div class="flexbox">
          <div class="search">
            <h1>Search this site</h1>
            <h3>Click on search icon, then type your keyword.</h3>
            <div>
              <input type="text" placeholder="       Search . . ." required />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
